import React from "react";

const Career = () => {
  return (
    <div className="container mx-auto px-4 py-6">
      <h1 className="text-2xl font-bold">Careers</h1>
      <p>Join our team and help us build something amazing!</p>
    </div>
  );
};

export default Career;
